import $ from 'jquery';
import React from 'react';
import {
  Barchart, Bar, Brush, ReferenceLine, XAxis, YAxis,
  CartesianGrid, Tooltip, Legend,
} from 'recharts';

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [],
    };
    this.serverRequest = this.serverRequest.bind(this);
  }
  serverRequest(){
    $.get("http://localhost:5000/api/logs/items", res => {
      console.log(res);
      this.setState({
        items: res
      },()=>{
        console.log(this.state.items[0].name)
      });
    });
  }
  componentDidMount(){
    this.serverRequest();
  }
  render() {
    return (
      <div>
          {this.state.items.map(item => (
            <h1>item.name</h1>
          ))}
      </div>
    )
  }
}

export default Home;
